__Dashboard__.css:
#app {
background-color: #EBF8FD }

.dashboard-header .dashboard-component-header.header-large {
    background-image: url(/static/assets/images/ace_logo.png);
    background-repeat: no-repeat;
    padding-left: 122px;
    background-size: 112px;
    background-position-y: 15px;
    text-align: center;
    width: 95%;
    display: inline-block;
    font-size: 28px;
    color: #343434;
    font-family: calibri;
    font-weight: bold;
}
.dashboard-header .dashboard-component-header.header-large .fave-unfave-icon{
  display: inline-block;
}

.dashboard .chart-header>.header-title {
    text-align: center;
    font-family: calibri;
    font-size: 20px;
}



.dashboard-header {
    background: #EBF8FD;
}

.ant-tabs-content-holder {
background-color: #EBF8FD; }


.dashboard .chart-header>.header-title {
text-align: center; }

.ant-select-item-option-content {
    font-size: 11px;
}
span.ant-select-selection-placeholder {
    font-size: 11px;
}

.dashboard-component-chart-holder.fade-in, .dashboard-component-chart-holder.fade-out {
    border-radius: 10px;
}

.dashboard-component-chart-holder.fade-in, .dashboard-component-chart-holder.fade-out {
    box-shadow: 0 5px 5px -3px rgb(0 0 0 / 20%), 0 8px 10px 1px rgb(0 0 0 / 14%), 0 3px 14px 2px rgb(0 0 0 / 12%);
}

.ant-select-single.ant-select-show-arrow .ant-select-selection-item, .ant-select-single.ant-select-show-arrow .ant-select-selection-placeholder {
    font-size: 12px;
}



.ant-tabs 
    /* width */
::-webkit-scrollbar {
  width: 8px;
}

/* Track */
::-webkit-scrollbar-track {
  background: #f1f1f1; 
}
 
/* Handle */
::-webkit-scrollbar-thumb {
  background: #8b8888; 
}

/* Handle on hover */
::-webkit-scrollbar-thumb:hover {
  background: #555; 
}
